<html>
<head>
<meta charset="ISO-8859-1">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Article Detail</title>
<script type="text/javascript" src="script/jquery-3.1.0.min.js"></script>
<link rel="stylesheet" type="text/css"
	href="css/bootstrap_article_detail.min.css">
<link rel="stylesheet" type="text/css" href="css/header_footer.css">

<script type="text/javascript">
	$(document).ready(function() {
		$('#planoDisplay').click(function(e) {
			if ($('#svgContainer').css('display') == 'none') {
				$('#svgContainer').css('display', 'block');
			} else {
				$('#svgContainer').css('display', 'none');
			}
			$('div[role=content]').toggle();
		});
	});

	function fnLoadItemLookup() {
		window.location.assign('ItemLookup.html');
	}

	function fnLoadHome() {
		window.location.assign('Dashboard.html');
	}
	
	function fnLoadLogin() {
		window.location.assign('LoginScreen.html');
	}
</script>
<style>
.form-control {
	height: 55px;
	font-size: 12px;
	-webkit-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0);
}

label {
	font-weight: inherit;
}

.category-ribbon {
	padding: 5px;
	text-align: center;
	margin-bottom: 10px;
	border-top: 1px solid #dcdcdc;
}
</style>
</head>

<body style="padding-top: 1px; line-height: 22px;">

	<section class="row p0">

		<div class="col-lg-12 col-md-12 col-sm-12"
			style="padding: 12px 30px 12px 30px; background: rgba(230, 230, 230, 0.68); border-bottom: 1px solid rgba(85, 85, 85, 0.35)">
			<article
				class="col-lg-8 col-md-6 col-sm-8 col-xs-12 wag-header-logo-desktop hidden-xs">
				<figure>
					<img src="images/walgreens-logo-desktop.png" alt="Logo"
						aria-label="Walgreens-logo">
					<figcaption></figcaption>
				</figure>
			</article>
			<article
				class="col-md-6 col-sm-6 col-xs-12 p0 wag-header-logo-ipad wag-sticky wag-sticky-nav mobileLogo">
				<figure>
					<article class="hidden-xs">
						<img src="images/walgreens-tab-logo.wdp" alt="Logo"
							aria-label="Walgreens-logo">
					</article>
				</figure>
			</article>
			<article
				class="col-lg-4 col-md-6 col-sm-6 col-xs-12 p0 m0 userinfoABForLagyLoad"
				id="wag-user-info">
				<wag:userinfo-new-header>
					<section
						class="wag-userinfo-container wag-sticky-u wag-sticky-nav-user-info ng-scope"
						style="background: rgb(238, 238, 238);"
						ng-class="(UserInfoWithNewExp &amp;&amp; userinfo.recognizedState) ? 'wag-container-signin-notyou':''"
						ng-controller="userInfoController" ng-init="init()">
						<!-- ngIf: UserInfoWithNewExp -->
						<article class="wag-userinfo-wrapper pt3 ng-scope"
							ng-if="UserInfoWithNewExp">
							<!-- ngIf: (windowWidth > 767) -->
							<article class="wag-user-picture hidden-xs ng-scope"
								ng-if="(windowWidth > 767)">
								<img ng-src="images/Account_Avatar_DD.wdp" alt="user picture"
									src="images/Account_Avatar_DD.wdp">
							</article>
							<aside
								class="wag-header-userinfotab wag-header-youraccount-mobile pull-left">
								<!-- ngIf: userinfo.loggedin === 'true' || userinfo.recognizedState -->
								<div class="clearfix"></div>
								<div id="youaccountdropdown" aria-haspopup="true"
									aria-expanded="false"
									class="wag-header-youraccount-wrapper dropdown"
									ng-class="(userinfo.loggedin === 'true' || userinfo.recognizedState)?'wag-header-youraccount-wrapper-login':''">
									<span id="wag-youraccount-infomob"><a
										data-toggle="dropdown" href="#0" ng-click="yourAccountClick()"><span
											class="wag-youraccount-infomob">Demo User</b> &nbsp;<!-- ngIf: userinfo.notificationmsgcount !== 0 --></span>
											<figure id="wag-arrowinfo"
												class="p0 m0 wag-youaccount-userinfarrow">
												<!-- ngIf: userinfo.notificationmsgcount !== 0 -->
												<!-- ngIf: userinfo.notificationmsgcount === 0 -->
												<span ng-if="userinfo.notificationmsgcount === 0"
													class="icon-ArrowDown wag-youraccountdownicon hidden-xs ng-scope"
													ng-class="{'wag-youraccountdownicon-login':(userinfo.loggedin === 'true' || userinfo.recognizedState),'wag-youracc-big-txt':(userinfo.nameTruncated.length>=8),'wag-youracc-big-txt-l': (userinfo.nameTruncated.length>=8)}"></span>
												<!-- end ngIf: userinfo.notificationmsgcount === 0 -->
												<span
													class="wag-mobmenu-account-rightarrow icon-ChevronRight"></span>
												<figcaption></figcaption>
											</figure></a></span>

									<div class="clearfix"></div>
								</div>
								<!-- ngIf: userinfo.loggedin === 'false' && !userinfo.recognizedState -->
								<span class="wag-header-signin-span pl5 ng-scope"
									ng-if="userinfo.loggedin === 'false' &amp;&amp; !userinfo.recognizedState"><a
									class="wag-header-signin-mobile" href="javascript: void(0);"
									ng-click="signinRedirection()" onclick="fnLoadHome();">Home</a> <span
									class="wag-header-userinfo-or">&nbsp;</span> <a
									class="wag-header-signin-mobile" href="javascript: void(0);"
									ng-click="registerRedirection()" onclick="fnLoadLogin();">Logout</a></span>
								<!-- end ngIf: userinfo.loggedin === 'false' && !userinfo.recognizedState -->
							</aside>

						</article>
						<!-- end ngIf: UserInfoWithNewExp -->
					</section>
				</wag:userinfo-new-header>
			</article>

		</div>
	</section>

	<div class="container form-horizontal"
		style="background-color: #ffffff; border: 0px; margin-top: 20px;">
		<!-- Text input-->
		<div class="form-group">
			<div
				class="col-xs-12 col-sm-12 col-md-12 col-lg-12 inputGroupContainer">
				<div class="input-group">
					<span class="input-group-addon" style="background-color: #ffffff;"><i
						class="glyphicon glyphicon-menu-left"></i></span> <label
						class="form-control"
						style="text-align: center; border-right: 0px; border-left: 0px; vertical-align: middle; float: none;">Article
						Details</label><span class="input-group-addon"
						style="background-color: #ffffff;"><i
						class="glyphicon glyphicon-search"></i></span>
				</div>
			</div>
		</div>

		<div class="form-group">
			<div
				class="col-xs-12 col-sm-12 col-md-12 col-lg-12 inputGroupContainer">
				<div class="input-group">
					<label class="control-label">Filter</label><span
						class="input-group-addon"
						style="background-color: #fff; border: 0px #fff;"><i
						onclick="fnLoadHome();" class="glyphicon glyphicon-home"></i></span> <span
						class="input-group-addon"
						style="background-color: #fff; border: 0px #fff;"><i
						class="glyphicon glyphicon-filter"></i></span><span
						class="input-group-addon"
						style="background-color: #fff; border: 0px #fff;"><i
						class="glyphicon glyphicon-sort"></i></span> <span
						class="input-group-addon"
						style="background-color: #fff; border: 0px #fff;"><i
						id="planoDisplay" class="glyphicon glyphicon-menu-hamburger"></i></span>
				</div>
			</div>
		</div>
